import React from 'react';
import TagButton from './TagButton'

import $ from 'jquery'

class TagContainer extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            tags: [
                {name: "abc"},
                {name: "qwe"}
            ],
		}
    }

	render(){
        const func = () => {
            $.each(this.props.tags, () => {
                return(
                    <TagButton value={this.name}/>
                )
            })
            
        }
		return(
            <div>
                <h1>ЫЫЫЫЫЫ</h1>
                {func}
            </div>
        
		);
	}
}

export default TagContainer
